  };

  return (
    <div className="concerns-page">
      <h2>Choose Your Concern</h2>
      <div className="concerns-grid">
        <div className="concern" onClick={handleDrynessClick}>
          <h3>Dryness</h3>
          <p>Click here to view products for dryness</p>
        </div>
        {/* Add other quadrants */}
      </div>
    </div>
  );
};

